import React from "react";
import { Dropdown } from "./Dropdown";

export class Header extends React.Component {
    constructor(){
        super()
        this.state = {
          currency: [
            {
                id: 0,
                title: '$',
                selected: false,
                key: 'currency'
            },
            {
                id: 1,
                title: '€',
                selected: false,
                key: 'currency'
            },
            {
                id: 2,
                title: '£',
                selected: false,
                key: 'currency'
            },
          ]
         }
        }

    render() {
        return <header>
            <nav>
                <ul className="nav-list">
                    <li>women</li>
                    <li>men</li>
                    <li>kids</li>
                </ul>
            </nav>
            <img className="a-logo" src="./a-logo.png"></img>
            <div>
                <Dropdown 
                    title="$"
                    list={this.state.currency}
                />
                <img src="./empty-cart.png"></img>
            </div>
        </header>
    }
}
